// SPDX-License-Identifier: MIT

pragma solidity ^0.8.25;

contract variableTest {
    /**
     * 08
     * 变量初始值
     * 
     * 一般的就不写了
     * boolean string int 
     * 
     * 需要注意的
     * enum 第一个元素
     * address   address(0)
     * function  internal  external  都是默认空白
     * 
     * mapping 所有元素都是默认值
     * struct 成员都是默认值
     * array 定长数组，元素都是默认值
     * 
     * delete 元素     变为初始值
     * 
     */


    /**
     * 09
     * 可以节省gas，增加安全性
     * 
     * constant
     * 适用于  数值， string, bytes
     * 必须在声明时初始化，之后不可变
     * 
     * immutable
     * 适用于  数值
     * 声明时或者构造函数中初始化
     */


    /**
     * 10
     * 控制流
     * if else
     * for
     * while
     * do while
     * 三元
     * break continue
     */

    function insertSort(uint[] memory a) public pure returns (uint[] memory) {
        for(uint i = 1; i < a.length; i++) {
            for(uint j = 0; j < i; j++) {
                if(a[j] <= a[i]){
                    continue;
                }else{
                    uint tmp = a[i];
                    for(uint x=i; x>j;x--) {
                        a[x] = a[x-1];
                    }
                    a[j] = tmp;
                    break;
                }
            }
        }
        return a;
    }
}

